import React from 'react';
const CountriesCorona = () => {
	return (
		<table>
			<thead>
				<tr>
					<td>Country</td>
					<td>NewConfirmed</td>
					<td>TotalConfirmed</td>
					<td>NewDeaths</td>
					<td>TotalDeaths</td>
					<td>NewRecovered</td>
					<td>TotalRecovered</td>
				</tr>
			</thead>
		</table>
	);
};
export default React.memo(CountriesCorona);
